import React from "react";
import styled from "styled-components";

const NinthPage = () => {
  return (
    <Container>
      <img src="/images/model-s/big-blue.jpg" alt="" />
    </Container>
  );
};

const Container = styled.div`
  height: 100vh;
  img {
    height: 100%;
    width: 70%;
  }
`;

export default NinthPage;
